(18, 65, 'Price Table', 'price-table', '<p>Price table Custom HTML is based on the following structure:</p>\r\n\r\n<pre>&lt;div class="gkPriceTable gkPriceTableAnimated col3"&gt;\r\n&lt;dl&gt;\r\n&lt;dt&gt;Basic&lt;/dt&gt;\r\n&lt;dd class="gkPrice"&gt;$15&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href="#"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl class="gkPremium"&gt;\r\n&lt;dt&gt;Premium&lt;/dt&gt;\r\n&lt;dd class="gkPrice"&gt;$99&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;Try it for a month!&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href="#"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n\r\n&lt;dl&gt;\r\n&lt;dt&gt;Plus&lt;/dt&gt;\r\n&lt;dd class="gkPrice"&gt;$29&lt;small&gt;/ month&lt;/small&gt;&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Storage&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Transactions&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Contacts&lt;/dd&gt;\r\n&lt;dd&gt;Unlimited Users&lt;/dd&gt;\r\n&lt;dd&gt;&lt;a href="#"&gt;Choose&lt;/a&gt;&lt;/dd&gt;\r\n&lt;/dl&gt;\r\n&lt;/div&gt;</pre>\r\n\r\n<p>The main wrapper contains three clases: the <b>gkPriceTable</b> class is required, the <b>gkPriceTableAnimated</b> is required if you want to create an animated price table on scrolling and the last class is used to specify the amount of columns - you can use classes <b>col1</b>-<b>col5</b>.</p>\r\n\r\n<p>Every column is specified by <b>dl</b> element (with <b>gkPremium</b> class the column will be highlighted) - in the <b>dt</b> element you can specify the table column title. In the <b>dd</b> element with <b>gkPrice</b> class you can specify the price - using the <b>small</b> element you can specify te service period time.</p>\r\n<p>Adding of the button at the bottom is very simple - it needs just to add the link element in the <b>dd</b> element.</p>', '', 1, 15, '2013-03-04 13:50:52', 572, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2013-03-04 13:50:52', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 1, 1, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(19, 66, 'Frontpage elements', 'frontpage-elements', '<p>Frontpage can contain big header image if you add in the template settings (on the "Features" tab the <strong>imageBg</strong> page suffix.</p>\r\n<h3>Header form</h3>\r\n<p>Header form is based on the following code:</p>\r\n<pre>&lt;h1&gt;Start 30-Day free trial today. Set up in instant&lt;/h1&gt;\r\n&lt;h2&gt;Powerful landing page theme for running serious business&lt;/h2&gt;\r\n&lt;form class="gk-form"&gt;\r\n&lt;div&gt;&lt;input type="email" placeholder="Email address ..." /&gt; &lt;input type="submit" value="Get Started today!" /&gt;&lt;/div&gt;\r\n&lt;/form&gt;\r\n&lt;p&gt;&lt;a class="gk-video-link modal" href="http://www.youtube.com/embed/vb2eObvmvdI" rel="{handler: ''iframe'', size: {x: 560, y: 315}}"&gt;Watch the introduction&lt;/a&gt;&lt;/p&gt;</pre>\r\n<p>As you can see it uses <strong>h1</strong> and <strong>h2</strong> elements for creating headers, then the form is wrapped in the <strong>form</strong> element with <strong>gk-form</strong> class. The <strong>input</strong> elements are automatically styled inside the form. Additionally under the form there is the link with classes <strong>gk-video-link</strong> and <strong>modal</strong> - first class is responsible for the styling, second one is responsible for the popup - it uses the Joomla! built-in popup mechanism.</p>\r\n<p>In every module with <b>centered</b> suffix you can place a paragraph with <b>gkCentered</b> class.</p>\r\n<h3>Icons</h3>\r\n<p>Icons placed on the frontpage uses the following structure:</p>\r\n<pre>&lt;div class="gkIcons"&gt;\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkCrop"&gt;Creative&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Creative&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkRocket"&gt;Rocket&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Powerful Control&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div&gt;\r\n&lt;div class="gkIconArea"&gt;\r\n&lt;a href="#" class="gkMobile"&gt;Responsive&lt;/a&gt;\r\n&lt;/div&gt;\r\n&lt;h2&gt;Responsive Design&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. &lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;</pre>\r\n<p>Every column is placed in the <b>div</b> container which contains a container with class <b>gkIconArea</b> with link using one of these classes: <b>gkCrop</b>, <b>gkRocket</b> or <b>gkMobile</b>.</p>\r\n<p>Under the icon area you can place the <b>h2</b> element with title and paragraph with description</p>\r\n<h3>Sliding notebook</h3>\r\n<p>To create the two columns block with the sliding image you should use the following structure:</p>\r\n<pre>&lt;div class="gkHorizontalSlide"&gt;\r\n&lt;div class="gkHorizontalSlideLeftColumn"&gt;\r\n&lt;h2&gt;Joomla! and WordPress blog theme\r\ninspired by Metro Windows 8 UI&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus eget elit eu velit vehicula feugiat. Integer viverra metus vitae lectus dictum eleifend. Lorem ipsum dolor sit amet. Donec viverra lobortis feugiat. Sed id odio ante.&lt;/p&gt;\r\n&lt;p&gt;Duis bibendum metus eu urna placerat mattis! Duis bibendum tempor massa at tristique. Integer viverr metus vitae lectus dictum eleifend amet.&lt;/p&gt;\r\n&lt;p&gt;&lt;a href="#" class="button"&gt;View Details&lt;/a&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;div class="gkHorizontalSlideRightColumn"&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/demo_notebook.png" alt="Notebook" /&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;</pre>\r\n<p>The most important part are the containers with classes: <b>gkHorizontalSlideLeftColumn</b> and <b>gkHorizontalSlideRightColumn</b> - in the second container there should be placed an image which will slide on scroll.</p>\r\n<h3>Sliding tablet</h3>\r\n<p>The sliding tablet effect is created using the following structure:</p>\r\n<pre>&lt;div class="gkTextBlock"&gt;\r\n&lt;h2&gt;We build responsive,&lt;br /&gt;mobile-friendly website&lt;/h2&gt;\r\n&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nam scelerisque faucibus risus non iaculis. Fusce a augue ante, pellentesque pretium erat. Fusce in turpis in velit tempor pretium. Integer a leo libero.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;img src="templates/gk_simplicity/images/demo/manufacturers.png" alt="Manufacturers" /&gt;\r\n\r\n&lt;img src="templates/gk_simplicity/images/demo/tablet_image.png" class="gkImageBlock" alt="Image block" /&gt;</pre>\r\n<p>The sliding image is placed in the <b>gkImageBlock</b> wrapper. The <b>gkTextBlock</b> class adds necessary top spacing for the text block.</p>\r\n<h3> </h3>\r\n<h3>Button area</h3>\r\n<p>The last custom HTML element from the frontpage uses the following structure:</p>\r\n<pre>&lt;div class="gkButtonArea"&gt;\r\n&lt;h3&gt;The 30 day free trial includes all features.&lt;small&gt;Your 30-day money back guarantee starts after your 30-day free trial.&lt;/small&gt;&lt;/h3&gt;\r\n&lt;a href="#"&gt;Get Started&lt;/a&gt;\r\n&lt;/div&gt;</pre>\r\n<p>Every link placed in the <b>gkButtonArea</b> element creates a big button floated to right.</p>', '', 1, 15, '2013-03-04 13:52:03', 572, '', '2015-06-20 21:54:49', 254, 0, '0000-00-00 00:00:00', '2013-03-04 13:52:03', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":"1"}', 3, 0, '', '', 1, 6, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
