int_behaviour":"1","favicon_image":"","stylearea":"1","framework_logo":"1","webmaster_contact_type":"1","webmaster_contact":"webmaster@gavick.com","typography":"0","typo_iconset":"0","tools":"1","show_menu":"1","startlevel":"0","endlevel":"-1","menu_animation":"slide","menu_height":"0","menu_width":"0","menu_col_width":"200","menu_duration":"500","fb_api_id":"","fb_lang":"en_US","fb_login":"0","fb_like":"0","fb_like_send":"0","fb_like_layout":"standard","fb_like_show_faces":"true","fb_like_width":"500","fb_like_action":"like","fb_like_font":"arial","fb_like_colorscheme":"light","google_plus":"1","google_plus_count":"1","google_plus_size":"medium","google_plus_lang":"en-GB","google_plus_share":"1","google_plus_share_annotation":"vertical-bubble","google_plus_share_size":"20","tweet_btn":"0","tweet_btn_data_count":"vertical","tweet_btn_data_via":"","tweet_btn_data_lang":"en","pinterest_btn":"0","pinterest_btn_style":"horizontal","excluded_cats":"","cookie_consent":"0","consenttype":"explicit","cookie_latest_version":"0","cookie_use_ssl":"0","banner_position":"bottom","banner_tag_placement":"bottom-right","cookie_style":"light","refreshOnConsent":"0","cookiecss":"1","use_gk_cache":"0","css_cache":"0","css_compression":"0","css_override":"0","css_prefixer":"0","js_compression":"0"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
